import './App.css';
import axios from 'axios';
import useState from 'react';
import { useQuery } from "react-query";
function App() {
  const {lampStatus,setLampStatus} = useState()
  const { isLoading, error, data, isFetching } = useQuery(["lamp"], () =>
    axios
      .get("http://localhost:5000/lamp")
      .then((res) => setLampStatus(res.data)),
  );
  return (
    <div className="App">
      <h1>Casd</h1>
    </div>
  );
}

export default App;
